    render() {
        const e = this.props
        return (
            <tr key={e.id} >
                <td>{e.name}</td>
                <td>{e.genre}</td>
                <td>{e.drinks}</td>
                <td>
                    <button>
                        Look for date
                    </button>
                </td>
            </tr>
        )
    }
}

export default Establishment
